import { createStore } from 'vuex'
import axios from 'axios'

export default createStore({
  state: {
    products: []
  },
  mutations: {
    setProducts (state, products) {
      state.products = products;
    }
  },
  actions: {

    loadProducts({ commit }) {
      axios
      .get('https://fakestoreapi.com/products')
      .then(response => {
        commit('setProducts', response.data);
      })
    }

  },
  modules: {
  }
})
